import React from 'react';
import {USERS} from '../data';

export const tableHeader = function (){
    return (
        <div class="row">
            <div class="col">
            <table className="tableHeader">
          <tr>
            <th>ID:</th>
            <th>NAME:</th>
            <th>ROLE</th>
            <th>EMAIL</th>
          </tr>
        </table>
            </div>
        </div>
    )
}
